import React from 'react'
import Box from '@mui/material/Box';
import {ReactComponent as EmojiIcon} from "../../../../../Assets/emoji_icon.svg"

function ChatEmoji() {
  return (
    <Box sx={{
      bgcolor: "blue",
      padding: {
        xs: "0px 20px",
        lg: "0px 40px", // Padding top and bottom is 20px, padding left and right is 40px for larger devices
      },
      "& .MuiSvgIcon-root": {
        color: "black",
      },
    }}
  >
      <EmojiIcon/>
    </Box>
  )
}

export default ChatEmoji
